export const CHANGE_POOLS = 'CHANGE_POOLS';


export const initialState = {
    poolsData: "utaiba",

}

// The function, submitValue, is an 'action creator'
// The return value is an 'action'
export function submitValue(input) {
    return {
        type: CHANGE_POOLS,
        payload: {
            poolsData: input
        }
    }
}
